import "./App.css";
import Header from "./layouts/Header";
import TodoList from "./components/TodoList";
function App() {
  return (
    <div className="App">
      <Header />
      <TodoList />
      <input type="text" placeholder="할일 입력..." />
    </div>
  );
}

export default App;
